import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

export const Navigation = (Component) => {
  const Wrapper = (props) => {
    const navigate = useNavigate();
    const location = useLocation();
    return (
      <Component
        navigate={navigate}
        location={location}
        {...props}
        />
    );
  };
  
  return Wrapper;
};
